import "../Style/header.css"

function header() {
    return (
        <nav>
            <div>
            <div id="headerLogo"></div>
            <div>
                <ul id="navLinks">
                    <p className="nav-link">ABOUT</p>
                    <p className="nav-link">PROJECTS</p>
                    <p className="nav-link"> CONTACT</p>
                </ul>
            </div>
            </div>
        </nav>
    );
}

export default header;
